import React from 'react';

const PersonalInfo = () => {
  return (
    <section className="info-personal">
      <h2>Informacion Personal</h2>
      <p>Nombre: Cristian Ronaldo</p>
      <p>Edad: 37 años</p>
      <p>Ubicacion: Dubai</p>
      <p>Descripción: Soy un amante de la tecnología, la programación y el fútbol de vez en cuando.</p>
    </section>
  );
}

export default PersonalInfo;
